import './App.css';

import Data from '../public/api/mock-api/data.json';
function App() {
  return (
    <div className="App">
      {
        Data.map(data => {
          return (
            <div className="box">
              {data.id}
            </div>
          )
        })
      }
    </div>
  );
}
export default App;
